import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { AuthProvider } from "./Auth";
import PrivateRoute from "./PrivateRoute";
import LoginStepPhoneEmail from "./pages/Login/LoginPhoneEmail";
import SignupStepPhoneEmail from "./pages/Signup/SignupEmail";
import Rooms from "./pages/Rooms/Rooms";
import Home from "./pages/Home/Home";
import Activate from "./pages/Activate/Activate";
import SetAvatar from "./pages/Steps/stepAvatar/StepAvatar";
import Navigation from "./components/shared/Navigation/Navigation";
const App = () => {
  return (
    <AuthProvider>
      <Router>
      <Navigation/>
        <div>
          <PrivateRoute exact path="/" component={Rooms} />
          <Route exact path="/login" component={LoginStepPhoneEmail} />
          <Route exact path="/signup" component={Activate} />
          <Route exact path="/home" component={Home} />  
          <PrivateRoute exact path="/room" component={Rooms} />     
          {/* <Route exact path="/activate" component={Activate}/>    */}
          <Route exact path="/setavatar" component={SetAvatar}/>
        </div>
      </Router>
    </AuthProvider>
  );
};

export default App;
